import React from 'react';

const Map = () => {
  // Bicholim, Goa coordinates (approximate)
  const bicholimCoordinates = {
    lat: 15.5964,
    lng: 73.9506
  };

  return (
    <div className="w-full h-96 rounded-lg overflow-hidden shadow-md">
      <iframe
        src={`https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d15389.08205182896!2d${bicholimCoordinates.lng}!3d${bicholimCoordinates.lat}!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3bbfc7895d00d9a5%3A0x9f33e77bac01ccf2!2sBicholim%2C%20Goa!5e0!3m2!1sen!2sin!4v1690892100000!5m2!1sen!2sin`}
        width="100%"
        height="100%"
        style={{ border: 0 }}
        allowFullScreen=""
        loading="lazy"
        referrerPolicy="no-referrer-when-downgrade"
        title="ClearView Optical Location in Bicholim, Goa"
      ></iframe>
    </div>
  );
};

export default Map;
